@Cyril_Ruel @LivingColour @vurnt22 @RollingStone Guitar is not a competiitve sport for me. 
On any given day for me it could be Van Halen or Nick Drake, Vernon Reid or Tom Verlaine, Randy Rhoads or Gary Louris that I'm listening to.
So many players bring something to the table from Ernie Isley to  Holdsworth, Zappa to Hooker.
